import React from 'react';
import './projects.css'


class Projects extends React.Component {
    render() {
        return (
            <React.Fragment>
                <p className="projects-title">Projects</p>
                <p className="projects-description">
                    The following projects have been made during my
                    freetime. The purpose of developing the following projects
                    was for fun and learning new technologies, as well
                    as experiment and learn about how powerful or useful such
                    technologies can be.
                </p>
                <div className="projects-options">
                    <button className="btn-projects">StackRecette<br/><span>Java</span></button>
                    <button className="btn-projects">Material-Pokedex</button>
                    <button className="btn-projects">Project-Prototype</button>
                    <button className="btn-projects">Transposer</button>
                </div>
            </React.Fragment>
        );
    }
}

export default Projects;
